void proc_control::proc_control_quaternionBase_log(real_T q_a, real_T q_b,
  real_T q_c, real_T q_d, real_T *b_q_a, real_T *b_q_b, real_T *b_q_c, real_T
  *b_q_d)
{
  real_T qnorm;
  real_T vnorm;
  real_T vscale_data;
  real_T z_data;
  int32_T vscale_size[2];
  int32_T z_size[2];
  int32_T b_i;
  int32_T nx;
  int32_T trueCount;
  vnorm = std::sqrt((q_b * q_b + q_c * q_c) + q_d * q_d);
  qnorm = std::sqrt(q_a * q_a + vnorm * vnorm);
  trueCount = 0;
  if (vnorm != 0.0) {
    for (b_i = 0; b_i < 1; b_i++) {
      trueCount++;
    }
  }

  b_i = 0;
  if (vnorm != 0.0) {
    for (nx = 0; nx < 1; nx++) {
      b_i++;
    }
  }

  z_size[0] = 1;
  z_size[1] = b_i;
  for (nx = 0; nx < b_i; nx++) {
    z_data = q_a / qnorm;
  }

  vscale_size[0] = 1;
  vscale_size[1] = b_i;
  if (b_i - 1 >= 0) {
    vscale_data = z_data;
  }

  nx = b_i - 1;
  for (b_i = 0; b_i <= nx; b_i++) {
    vscale_data = std::acos(vscale_data);
  }

  if (z_size[1] == trueCount) {
    trueCount = z_size[1] - 1;
    vscale_size[0] = 1;
    for (nx = 0; nx <= trueCount; nx++) {
      vscale_data /= vnorm;
    }
  } else {
    pro_binary_expand_op_pr351ewpk3(&vscale_data, vscale_size, vnorm, trueCount);
  }

  nx = 0;
  if (vnorm != 0.0) {
    for (b_i = 0; b_i < 1; b_i++) {
      nx++;
    }
  }

  if (nx == vscale_size[1]) {
    z_size[0] = 1;
    z_size[1] = nx;
    if (vscale_size[1] - 1 >= 0) {
      z_data = q_b * vscale_data;
    }
  } else {
    proc_binary_expand_op_pr351ewpk(&z_data, z_size, q_b, nx, &vscale_data,
      vscale_size);
  }

  *b_q_d = q_b;
  if (vnorm != 0.0) {
    for (b_i = 0; b_i < 1; b_i++) {
      *b_q_d = z_data;
    }
  }

  *b_q_b = *b_q_d;
  if (!(vnorm != 0.0)) {
    *b_q_b = 0.0;
  }

  nx = 0;
  if (vnorm != 0.0) {
    for (b_i = 0; b_i < 1; b_i++) {
      nx++;
    }
  }

  if (nx == vscale_size[1]) {
    if (vscale_size[1] - 1 >= 0) {
      z_data = q_c * vscale_data;
    }
  } else {
    proc_binary_expand_op_pr351ewpk(&z_data, z_size, q_c, nx, &vscale_data,
      vscale_size);
  }

  *b_q_d = q_c;
  if (vnorm != 0.0) {
    for (b_i = 0; b_i < 1; b_i++) {
      *b_q_d = z_data;
    }
  }

  *b_q_c = *b_q_d;
  if (!(vnorm != 0.0)) {
    *b_q_c = 0.0;
  }

  nx = 0;
  if (vnorm != 0.0) {
    for (b_i = 0; b_i < 1; b_i++) {
      nx++;
    }
  }

  if (nx == vscale_size[1]) {
    trueCount = vscale_size[1] - 1;
    for (nx = 0; nx <= trueCount; nx++) {
      vscale_data *= q_d;
    }
  } else {
    proc__binary_expand_op_pr351ewp(&vscale_data, vscale_size, q_d, nx);
  }

  *b_q_d = q_d;
  if (vnorm != 0.0) {
    for (b_i = 0; b_i < 1; b_i++) {
      *b_q_d = vscale_data;
    }
  }

  if (!(vnorm != 0.0)) {
    *b_q_d = 0.0;
  }

  *b_q_a = std::log(qnorm);
}

quaternion_proc_control_T proc_control::proc_computeFirstQuatDerivative(real_T
  pn_a, real_T pn_b, real_T pn_c, real_T pn_d, real_T qn_a, real_T qn_b, real_T
  qn_c, real_T qn_d, real_T sd, real_T qinterp_a, real_T qinterp_b, real_T
  qinterp_c, real_T qinterp_d)
{
  quaternion_proc_control_T qdot;
  real_T y_a;
  real_T y_b;
  real_T y_c;
  real_T y_d;
  proc_control_quaternionBase_log(((pn_a * qn_a - -pn_b * qn_b) - -pn_c * qn_c)
    - -pn_d * qn_d, ((pn_a * qn_b + -pn_b * qn_a) + -pn_c * qn_d) - -pn_d * qn_c,
    ((pn_a * qn_c - -pn_b * qn_d) + -pn_c * qn_a) + -pn_d * qn_b, ((pn_a * qn_d
    + -pn_b * qn_c) - -pn_c * qn_b) + -pn_d * qn_a, &y_a, &y_b, &y_c, &y_d);
  qdot.a = (((qinterp_a * y_a - qinterp_b * y_b) - qinterp_c * y_c) - qinterp_d *
            y_d) * sd;
  qdot.b = (((qinterp_a * y_b + qinterp_b * y_a) + qinterp_c * y_d) - qinterp_d *
            y_c) * sd;
  qdot.c = (((qinterp_a * y_c - qinterp_b * y_d) + qinterp_c * y_a) + qinterp_d *
            y_b) * sd;
  qdot.d = (((qinterp_a * y_d + qinterp_b * y_c) - qinterp_c * y_b) + qinterp_d *
            y_a) * sd;
  return qdot;
}

void proc_control::proc_control_ppval_p(const real_T pp_breaks[4], const real_T
  pp_coefs[36], real_T x, real_T v[3])
{
  if (std::isnan(x)) {
    v[0] = x;
    v[1] = x;
    v[2] = x;
  } else {
    real_T xloc;
    int32_T high_i;
    int32_T ic0;
    int32_T low_i;
    int32_T low_ip1;
    low_i = 0;
    low_ip1 = 1;
    high_i = 4;
    while (high_i > low_ip1 + 1) {
      ic0 = ((low_i + high_i) + 1) >> 1;
      if (x >= pp_breaks[ic0 - 1]) {
        low_i = ic0 - 1;
        low_ip1 = ic0;
      } else {
        high_i = ic0;
      }
    }

    low_ip1 = low_i * 3;
    xloc = x - pp_breaks[low_i];
    v[0] = pp_coefs[low_ip1];
    v[1] = pp_coefs[low_ip1 + 1];
    v[2] = pp_coefs[low_ip1 + 2];
    for (high_i = 0; high_i < 3; high_i++) {
      ic0 = ((high_i + 1) * 9 + low_ip1) - 1;
      v[0] = xloc * v[0] + pp_coefs[ic0 + 1];
      v[1] = xloc * v[1] + pp_coefs[ic0 + 2];
      v[2] = xloc * v[2] + pp_coefs[ic0 + 3];
    }
  }
}

void proc_control::proc_TrajectoryManager_stepImpl
  (TrajectoryManager_proc_contro_T *b_this, real_T reset, const real_T poses[13],
   const real_T target[7], const real_T x0[7], const real_T mesuredPose[13],
   real_T currentPose[130], boolean_T *isReached)
{
  int32_T b_index;
  int32_T b_index_0;
  int32_T b_itilerow;
  int32_T b_jcol;
  int32_T ibmat;
  boolean_T exitg1;
  boolean_T isempty;
  boolean_T y;

  //  Main execute a chaque iteration.
  //  Implement algorithm. Calculate y as a function of input u and
  if (reset == 1.0) {
    b_this->init = 0.0;
  }

  if (b_this->init == 0.0) {
    //  Conditions Initiales
    for (ibmat = 0; ibmat < 7; ibmat++) {
      proc_control_B.a_d[ibmat] = x0[ibmat];
    }

    proc_control_B.a_d[7] = 0.0;
    proc_control_B.a_d[8] = 0.0;
    proc_control_B.a_d[9] = 0.0;
    proc_control_B.a_d[10] = 0.0;
    proc_control_B.a_d[11] = 0.0;
    proc_control_B.a_d[12] = 0.0;
    for (b_jcol = 0; b_jcol < 13; b_jcol++) {
      ibmat = b_jcol * 10;
      for (b_itilerow = 0; b_itilerow < 10; b_itilerow++) {
        proc_control_B.b[ibmat + b_itilerow] = proc_control_B.a_d[b_jcol];
        b_this->poseBuffer[((b_itilerow + 1) + 6001 * b_jcol) - 1] =
          proc_control_B.b[10 * b_jcol + b_itilerow];
      }
    }

    // InitCond;
    b_this->bufferCount = 1.0;
    b_this->init = 1.0;
  }

  // this.BufferReset(reset,mp);
  //  Fonction qui traites les nouveau poses.
  //  Insertion des nouveaux points.
  // if new == this.generationNumber %new>
  if (b_this->bufferCount + 1.0 < 6001.0) {
    ibmat = static_cast<int32_T>(b_this->bufferCount + 1.0);
    for (b_jcol = 0; b_jcol < 13; b_jcol++) {
      b_this->poseBuffer[(ibmat + 6001 * b_jcol) - 1] = poses[b_jcol];
    }

    // this.poseBuffer(this.bufferCount:count + this.bufferCount,:) = pose(1:count+1,:) 
    b_this->bufferCount++;
    b_this->generationNumber++;
  } else {
    printf("%s\n", "Problem");
    fflush(stdout);
  }

  //  Fonction qui retourne la pose actuelle
  //  Vérification des prédictions.
  b_index = 2;
  isempty = false;
  b_itilerow = 0;
  exitg1 = false;
  while ((!exitg1) && (b_itilerow < 9)) {
    boolean_T exitg2;
    b_index = b_itilerow + 2;
    for (ibmat = 0; ibmat < 13; ibmat++) {
      proc_control_B.x_k[ibmat] = (b_this->poseBuffer[(6001 * ibmat + b_itilerow)
        + 1] == b_this->emptyArray[ibmat]);
    }

    y = true;
    b_jcol = 0;
    exitg2 = false;
    while ((!exitg2) && (b_jcol < 13)) {
      if (!proc_control_B.x_k[b_jcol]) {
        y = false;
        exitg2 = true;
      } else {
        b_jcol++;
      }
    }

    if (y) {
      isempty = true;
      exitg1 = true;
    } else {
      b_itilerow++;
    }
  }

  std::memset(&currentPose[0], 0, 130U * sizeof(real_T));
  ibmat = 0;
  b_jcol = 0;
  for (b_itilerow = 0; b_itilerow < 13; b_itilerow++) {
    for (b_index_0 = 0; b_index_0 < b_index; b_index_0++) {
      currentPose[b_index_0 + ibmat] = b_this->poseBuffer[b_index_0 + b_jcol];
    }

    ibmat += 10;
    b_jcol += 6001;
  }

  if (isempty) {
    b_itilerow = 10 - b_index;
    for (b_jcol = 0; b_jcol <= b_itilerow; b_jcol++) {
      b_index_0 = b_index + b_jcol;
      for (ibmat = 0; ibmat < 13; ibmat++) {
        proc_control_B.a_d[ibmat] = currentPose[(10 * ibmat + b_index) - 2];
      }

      for (ibmat = 0; ibmat < 13; ibmat++) {
        currentPose[(b_index_0 + 10 * ibmat) - 1] = proc_control_B.a_d[ibmat];
      }
    }
  }

  //  Ne pas supprimer le point si c'est le dernier.
  ibmat = 0;
  for (b_jcol = 0; b_jcol < 13; b_jcol++) {
    proc_control_B.x_k[b_jcol] = !(b_this->poseBuffer[ibmat + 10] ==
      b_this->emptyArray[b_jcol]);
    ibmat += 6001;
  }

  y = true;
  b_jcol = 0;
  exitg1 = false;
  while ((!exitg1) && (b_jcol < 13)) {
    if (!proc_control_B.x_k[b_jcol]) {
      y = false;
      exitg1 = true;
    } else {
      b_jcol++;
    }
  }

  if (y) {
    ibmat = 0;
    for (b_jcol = 0; b_jcol < 13; b_jcol++) {
      std::memcpy(&proc_control_B.b_this[ibmat], &b_this->poseBuffer[ibmat + 1],
                  6000U * sizeof(real_T));
      ibmat += 6001;
    }

    ibmat = 0;
    for (b_jcol = 0; b_jcol < 13; b_jcol++) {
      proc_control_B.b_this[ibmat + 6000] = b_this->emptyArray[b_jcol];
      ibmat += 6001;
    }

    std::memcpy(&b_this->poseBuffer[0], &proc_control_B.b_this[0], 78013U *
                sizeof(real_T));
    b_this->bufferCount--;
    b_this->done = false;
  } else {
    b_this->done = true;
  }

  //  Fonction qui verifie le target reached
  //  vérifier si la trajectoire est fini
  for (b_jcol = 0; b_jcol < 7; b_jcol++) {
    proc_control_B.x_p[b_jcol] = poses[b_jcol] - target[b_jcol];
    proc_control_B.y_c5[b_jcol] = std::abs(proc_control_B.x_p[b_jcol]);
  }

  b_this->done = true;
  b_jcol = 0;
  exitg1 = false;
  while ((!exitg1) && (b_jcol < 7)) {
    if (!(proc_control_B.y_c5[b_jcol] < 0.001)) {
      b_this->done = false;
      exitg1 = true;
    } else {
      b_jcol++;
    }
  }

  *isReached = false;

  //  vérifier le traget reached si la trajectoire est terminé
  if (b_this->done) {
    //  calcule de l'erreur de langle en 3D avec le quaternion
    proc_control_B.qRel[0] = ((target[3] * mesuredPose[3] - -target[4] *
      mesuredPose[4]) - -target[5] * mesuredPose[5]) - -target[6] * mesuredPose
      [6];
    proc_control_B.qRel[1] = (target[3] * mesuredPose[4] + -target[4] *
      mesuredPose[3]) + (-target[5] * mesuredPose[6] - -target[6] * mesuredPose
                         [5]);
    proc_control_B.qRel[2] = (target[3] * mesuredPose[5] + -target[5] *
      mesuredPose[3]) + (-target[6] * mesuredPose[4] - -target[4] * mesuredPose
                         [6]);
    proc_control_B.qRel[3] = (target[3] * mesuredPose[6] + mesuredPose[3] *
      -target[6]) + (-target[4] * mesuredPose[5] - -target[5] * mesuredPose[4]);

    //  vérifier si le sub est dans la zone de convergence (sphérique / conique) 
    proc_control_B.target_o[0] = target[0] - mesuredPose[0];
    proc_control_B.target_o[1] = target[1] - mesuredPose[1];
    proc_control_B.target_o[2] = target[2] - mesuredPose[2];
    if ((proc_control_norm_pr(proc_control_B.target_o) <
         b_this->linearConvergence) && (2.0 * rt_atan2d_snf(proc_control_norm_pr
          (&proc_control_B.qRel[1]), proc_control_B.qRel[0]) <
         b_this->quaternionConvergence)) {
      b_this->targetReachedCount++;
      *isReached = (b_this->targetReachedCount * 0.1 >= b_this->TargetThreshold);
    } else {
      b_this->targetReachedCount = 0.0;
    }
  }
}

