{
  return (x[0] + x[1]) + x[2];
}

void proc_control::proc_control_eml_find(const boolean_T x[3], int32_T i_data[],
  int32_T *i_size)
{
  int32_T b_ii;
  int32_T idx;
  boolean_T exitg1;
  idx = 0;
  b_ii = 1;
  exitg1 = false;
  while ((!exitg1) && (b_ii - 1 < 3)) {
    if (x[b_ii - 1]) {
      idx++;
      i_data[idx - 1] = b_ii;
      if (idx >= 3) {
        exitg1 = true;
      } else {
        b_ii++;
      }
    } else {
      b_ii++;
    }
  }

  if (idx < 1) {
    idx = 0;
  }

  *i_size = idx;
}

real_T proc_control::proc_control_sum(const real_T x_data[], const int32_T
  *x_size)
{
  real_T y;
  int32_T vlen;
  vlen = *x_size;
  if (*x_size == 0) {
    y = 0.0;
  } else {
    y = x_data[0];
    for (int32_T k{2}; k <= vlen; k++) {
      y += x_data[k - 1];
    }
  }

  return y;
}

